import React from 'react';
import './Css/table.css'
import axios from 'axios';
import ReactTable from "react-table";

export default class PersonList extends React.Component {
  state = {
    title: [],
    language: [],
    description: [],
    homepage: []
  }


  componentDidMount() {
    axios.get(`https://api.github.com/users/mikifriki/repos`)
      .then(rest => {
        const title = rest.data;
        const description = rest.data;
        const language = rest.data;
        const homepage = rest.data;
        this.setState({ homepage });
        this.setState({ language });
        this.setState({description})
        this.setState({ title });
      })



  }

  render() {
    return (
<section>
  <div class="tbl-content">
    <table className="headtb" cellpadding="0" cellspacing="0" border="0">
      <tbody>
        <tr>
        </tr>
        <tr className="tst">
          <th className="other">Projects:</th>
            {this.state.title.map(title => <td className="others">{title.name}</td>)}
        </tr>
        <tr>
            <th className="other">Description:</th>
              {this.state.description.map(description => <td className="others">{description.description}</td>)}
        </tr>
        <tr>
          <th className="other">Language:</th>
          {this.state.language.map(language => <td className="others">{language.language}</td>)}
        </tr>
        <tr>
          <th className="other">Demo site:</th>
          {this.state.homepage.map(homepage => <td className="others"><a></a>{homepage.homepage}</td>)}
        </tr>
      </tbody>
    </table>
  </div>
</section>
    )
  }
}
